import React from 'react';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<LoginPage />} />
          <Route path="/sign in" element={<PatientRegistrationForm />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
